import React from "react";
import ListItems from "./ListItems";

const GroupList = ({ todoList }) => {


  return (
    <ul className="list-group" style={{ width: "500px" }}>
      {todoList.map((item,index)=>(
        <ListItems  key={index} item={item} />
        ))}
    </ul>
  );
};

export default GroupList;
